import React from 'react';
import dayjs from 'dayjs';

const Header = ({ currentMonth, onNextMonth, onPrevMonth }) => {
  return (
    <div className="flex items-center justify-between p-4 bg-gray-100">
      <button onClick={onPrevMonth} className="px-4 py-2 bg-gray-300 rounded hover:bg-gray-400">
        Previous
      </button>
      <h2 className="text-xl font-bold">
        {dayjs(currentMonth).format('MMMM YYYY')}
      </h2>
      <button onClick={onNextMonth} className="px-4 py-2 bg-gray-300 rounded hover:bg-gray-400">
        Next
      </button>
    </div>
  );
};

export default Header;
